import React, { Component } from 'react'
import './History.css'



export default class History extends Component {
    constructor(props){
        super(props)
        this.state={
            isShow : false
        }

    }

    setShow(){
        this.setState({
          isShow: true
        })
      }

    setHide(){
        this.setState({
          isShow: false
        })
      }


    render() {


        return (
            <div className="header-his">
                <div className="header-hisimg">
                    <img src="https://cdn2.f-cdn.com/contestentries/365819/10129715/56e657a9c8e95_thumb900.jpg" alt="member" />
                </div>
                <div className="tbl-his" >

                    <table border="1" width='100%'>

                                <tr>
                                    <td>ชื่อ-นามสกุล</td>
                                    <td>ห้องที่จอง</td>
                                    <td>วันที่จอง</td>
                                    <td>เวลาเช็คอิน</td>
                                    <td>เวลาเช็คเอาท์</td>
                                    <td>Action</td>
                                </tr>
                                <tr>
                                    <td>Ada aar</td>
                                    <td>A1</td>
                                    <td>23/05/2555</td>
                                    <td></td>
                                    <td></td>
                                    <td>
                                        <button 
                                            style={{marginLeft:10,backgroundColor:"aqua",height:30,width:100}} 
                                            onClick={this.setShow.bind(this)}>
                                                CHECK IN
                                        </button>

                                        <button 
                                            style={{marginLeft:10,backgroundColor:"aqua",height:30,marginRight:10,width:100}}
                                            onClick={this.setHide.bind(this)}>
                                                CHECK OUT
                                        </button>
                                    </td>
                                </tr>

                    </table>
                </div>

            </div>
        )
    }
}
